// 527. Word Abbreviation
// https://leetcode.com/problems/word-abbreviation/

/*
Given an array of n distinct non-empty strings, you need to generate minimal possible abbreviations for every word following rules below.

Begin with the first character and then the number of characters abbreviated, which followed by the last character.
If there are any conflict, that is more than one words share the same abbreviation, a longer prefix is used instead of only the first character until making the map from word to abbreviation become unique. In other words, a final abbreviation cannot map to more than one original words.
If the abbreviation doesn't make the word shorter, then keep it as original.
Example:
Input: ["like", "god", "internal", "me", "internet", "interval", "intension", "face", "intrusion"]
Output: ["l2e","god","internal","me","i6t","interval","inte4n","f2e","intr4n"]
Note:
Both n and the length of each word will not exceed 400.
The length of each word is greater than 1.
The words consist of lowercase English letters only.
The return answers should be in the same order as the original array.
*/

#include <iostream>
#include <list>
#include <vector>
#include <array>
#include <unordered_map>

using namespace std;

class Solution {
public:
	vector<string> wordsAbbreviation(vector<string>& dict) {
		if (dict.empty()) {
			return dict;
		}
		int sz = dict.size(), i = 0;
		unordered_map<string, list<int>> A;
		for (i = 0; i < sz; ++i) {
			A[f1(dict[i], 1)].push_back(i);
		}
		vector<string> result(sz);
		for (const auto & i : A) {
			if (i.second.size() == 1) {
				result[i.second.front()] = i.first;
			}
			else {
				f2(result, dict, i.second);
			}
		}
		return result;
	}
private:
	struct Node {
		int cnt = 0;
		array<Node*, 26> next;
		Node() {
			cnt = 0;
			next.fill(NULL);
		}
	};
	string f1(const string & s, int presz) {
		int sz = s.size();
		if (2 + presz >= sz) {
			return s;
		}
		return s.substr(0, presz) + to_string(sz - presz - 1) + s.back();
	}
	void f2(vector<string> & result, const vector<string> & dict, const list<int> & l) {
		Node * root = new Node();
		for (const auto & i : l) {
			f3(root, dict[i]);
		}
		for (const auto & i : l) {
			result[i] = f4(root, dict[i]);
		}
		f5(root);
	}
	void f3(Node * root, const string & s) {
		++(root->cnt);
		int id = 0;
		for (const auto & ch : s) {
			id = ch - 'a';
			if (!root->next[id]) {
				root->next[id] = new Node();
			}
			root = root->next[id];
			++(root->cnt);
		}
	}
	string f4(Node * root, const string & s) {
		int depth = 0, id = 0;
		for (const auto & ch : s) {
			id = ch - 'a';
			++depth;
			root = root->next[id];
			if (root and root->cnt == 1) {
				break;
			}
		}
		return f1(s, depth);
	}
	void f5(Node * root) {
		if (root) {
			int i = 0;
			for (i = 0; i < 26; ++i) {
				f5(root->next[i]);
			}
			delete root;
		}
	}
};

int main(void) {
	Solution solution;
	vector<string> dict, result;
	
	dict = {"like", "god", "internal", "me", "internet", "interval", "intension", "face", "intrusion"};
	result = solution.wordsAbbreviation(dict);
	for (const auto & i : result) {
		cout << i << '\t';
	}
	cout << '\n';

	dict = {"abcdefg", "abccefg", "abcckkg"};
	result = solution.wordsAbbreviation(dict);
	for (const auto & i : result) {
		cout << i << '\t';
	}
	cout << '\n';
 
	dict = {"abcdefg", "abccefg", "abcckkg", "abccekg"};
	result = solution.wordsAbbreviation(dict);
	for (const auto & i : result) {
		cout << i << '\t';
	}
	cout << '\n';

	dict = {"leetcode"};
	result = solution.wordsAbbreviation(dict);
	for (const auto & i : result) {
		cout << i << '\t';
	}
	cout << '\n';

	dict = {"","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""};
	result = solution.wordsAbbreviation(dict);
	for (const auto & i : result) {
		cout << i << '\t';
	}
	cout << '\n';
	
	return 0;
}